/* eslint-disable */
import logo from './logo.svg';
import React, {useState} from 'react';
import './App.css';

function App() {
  let dode = "_blank";
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="d"
          href="https://reactjs.org"
          target={dode}
        >

          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
